import React from 'react';
import './Experience.css';

function Experience() {
  return (
    <div className="experience-container">
      <h2>/ experience</h2>
      <div className="job">
        <h3>Pricerite Cash & Carry</h3>
        <p>Business Analyst (July 2022 - July 2023)</p>
        <p>...reduced carrying costs by 20%...</p>
      </div>
    </div>
  );
}

export default Experience;
